import React from 'react';
import Navbar from './Navbar';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'; 


function App () {
    return(
        <Router>
            <div>
                <Navbar/>
                <Switch> /* */
                    <Route path = './about'>
                        About
                    </Route>
                    <Route path = '/'>
                        <h1>hihihi</h1>
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}

export default App;
